import React, { Component } from 'react'
import Dropdown from 'react-dropdown'
import 'react-dropdown/style.css'

export class Time extends Component {
  render() {
      const options = [
          10, 15, 20, 25, 30, 45
      ]
    return (
      <div>
          <Dropdown options={options}></Dropdown>
          <select>Test</select>
      </div>
    )
  }
}

export default Time
